import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.js';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import React from 'react';
import './App.css'

// pages
import Home from './pages/Home';
import Contact from './Pages/Contact';
import Service from './Pages/Service';
import Header from './elements/Header';
import Footer from './elements/Footer';
import Whyus from './Pages/Whyus';

// detail page
import Ourclient from './Pages/Ourclient';
import Clientdetail from './Pages/Clientdetail';
import Preload from './elements/Preload';
import Privacypolicy from './Pages/Privacypolicy';
import Terms from './Pages/Terms';
import { useState, useEffect } from "react";

//  helmet js
import { Helmet } from 'react-helmet';
import Scroll from './elements/Scroll';
import Hireus from './Pages/Hireus';
import Notfound from './Pages/Notfound';
import Freetrial from './Pages/Freetrial';

function App() {

    // preloader
    const [preload, setpreload] = useState(true);
    setTimeout(function () {
        setpreload(false);
    }, 1500); // <-- time in milliseconds

    // chnage btn
     const [ chnagename, setchnagename] = useState(false);

    return (
        <div className="App"   >
            <Helmet>
                <title>Graphic Design Company In India | Website Design Company India</title>
                <meta name="title" content="Graphic Design Company In India | Website Design Company India" /> 
                <meta name="description" content="As the leading website design Company India, we strive for excellence and aesthetics work for custom Website design, responsible design, high-speed website. Hire a web designer expert from us, and add a distinct look & feel to your dream website." />
                <meta property="description"  content="As the leading website design Company India, we strive for excellence and aesthetics work for custom Website design, responsible design, high-speed website. Hire a web designer expert from us, and add a distinct look & feel to your dream website." />
  	            <meta name="keywords" content="Web Design Services, Web Development Company, html web designing company, Html Web Developer, Graphic Design Company In India, Graphic Design Agency In India"/> 
                <meta property="keywords" content="Web Design Services, Web Development Company, html web designing company, Html Web Developer, Graphic Design Company In India, Graphic Design Agency In India "/> 

            </Helmet>
            {preload
                ? <Preload />
                : <Router>
                    <Header />
                    {/* switch cases */}
                    <Scroll >
                        <Switch>
                            <Route exact path="/">
                                <Home />
                            </Route>
                            <Route path="/why-us">
                                <Whyus />
                            </Route>
                            <Route path="/services">
                                <Service />
                            </Route>
                            <Route exact path="/our-clients">
                                <Ourclient />
                            </Route>
                            <Route path="/our-clients/:clientid">
                                <Clientdetail />
                            </Route>
                            <Route path="/contact">
                                <Contact />
                            </Route>
                            <Route path="/privacy-policy">
                                <Privacypolicy />
                            </Route>
                            <Route path="/terms-and-condition">
                                <Terms />
                            </Route>
                            <Route path="/hire-developers">
                                <Hireus />
                            </Route>
                            <Route path="/risk-free-trial">
                                <Freetrial />
                            </Route>
                            <Route path="*">
                                <Notfound />
                            </Route>
                            <Route>
                                <Notfound />
                            </Route>
                        </Switch>
                    </Scroll>
                    {/* footer */}
                    <Footer />
                </Router>
            }
        </div>
    );
}
export default App;
